package string;

public class SwapTwoVariableWithThirdVar {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int no1, no2, no3;
        no1 = 10;
        no2 = 20;

        // swap numbers
        no3 = no1;
        no1 = no2;
        no2 = no3;

        // print values after swapping
        System.out.println("After swapping - no1: "+ no1 +", no2: " + no2);
	}

}
